import "./sort.css";
const Sort = () => {
  
  const sortItems = ["Самый дешевый", "Самый быстрый", "Самый оптимальный"];
  return (
    <div className="sort">
      {sortItems.map((item, index) => (
        <div className="sort__item" key={index}>
          {item}
        </div>
      ))}
    </div>
  );
};

export default Sort;
